import React from 'react';
import { Link } from 'react-router-dom';
import { Row, Col, Card, Button } from 'react-bootstrap';
const PokeList = (pokemons) => {
    let urImage = 'https://github.com/PokeAPI/sprites/blob/master/sprites/pokemon/other-sprites/official-artwork/';
    return (
        <div>
            <Row>
                {
                    pokemons.map((pokemon)=>(
                        <Col xs={3} >
                        <Card style={{ width: '18rem'}}>
                            <Card.Body>
                                <Card.Text>
                                <Card.Img variant="top" src={`${urlImage}/${pokemon.id}.png`} />
                                </Card.Text>
                                <Button variant="primary">{pokemon.name}</Button>
                            </Card.Body>
                        </Card>
                    </Col>
                    ))
                }
            </Row>
        </div>
    );
}
export default PokeList;
